	downLoad:function (user_id,callback) {
            
		var me=this;
		 var me = this;
            //从服务器加载数据到本地
            var url = host + 'api/object/GetMyObjectList/' + user_id;
            util.get(url, function(syncObject) {
                  var mystock=[];
                  syncObject.objects.map(function(item,i){
                        mystock.push({
                              code:item.code,
                              name:item.name,
                              type:item.type,
                              symbol:item.symbol,
                              date:item.date,
                              price:item.price,
                              yestclose:item.yestclose,
                              sort:(item.sort||0),
                              inhand:item.inhand||false,
                              day:0,
                              week:0,
                              month:0,
                              last_day:0,
                              last_week:0,
                              last_month:0
                        })
                  });
                  var sorts=mystock.sort(function (a,b) {
                        return b.sort-a.sort;
                  });
                  // objectLocal.save(sorts);
                  callback&&callback(sorts);
                  
            })
		
		// });
	},
	upLoad:function (callback) {
		var me=this;
            //上传本地数据到服务器
            
            userLocal.get(function(err, user) {
                  if (err) {
                        callback && callback(err);
                        return;
                  }

                  objectLocal.get(function(error, stocks) {
                        
                        if (error) return callback && callback(error);

                        var stockList = stocks.map(function(stock, i) {
                              return {
                                    code: stock.code,
                                    type: stock.type,
                                    sort: stock.sort
                              };
                        });
                        var url = host + 'api/object/PostMyObject';
                        util.post(url, {
                              user_id: user.id,
                              objects: stockList
                        }, function(info) {
                              
                              if (info && info.success) {
                                    callback && callback(null,true);
                              }else{
                                    callback && callback(new Error('upLoad error'));
                              }
                        });
                  });

            });
	}
